import React from 'react';
import './Buttons.css'
import styled from 'styled-components';


const Center = styled.div`
padding-left: 5px;
padding-right: 5px;
padding-top: 0px;
background: none;


`




const BtnDiv = styled.div`
width: 30px;
display: inline-block;
`






const Buttons = (props) => {
  return (

<Center>

    <button></button>
    <BtnDiv></BtnDiv>
  <button> </button>
  <BtnDiv></BtnDiv>
  <button> </button>
  <BtnDiv></BtnDiv>
  <button> </button>
  <BtnDiv></BtnDiv>
</Center>
)
}


export default Buttons;
